import { useState,useEffect } from "react";
import './styles/Login.css';

function CreateUser() {
    var user = {
        email: document.getElementsByClassName("email-field").value,
        password: document.getElementsByClassName("password-field").value,
        name: document.getElementsByClassName("name-field").value,
        lastname: document.getElementsByClassName("lastname-field").value,
        documentation: document.getElementsByClassName("documentation-field").value,
    }
    console.log(user)
}

function Register() {
    return (
        <div>
            <form className="register-form">
                <input id="email-field" placeholder="Email" type="email"></input>
                <input id="password-field" placeholder="ContraseÃ±a" type="password"></input>
                <input id="name-field" placeholder="Nombre"></input>
                <input id="lastname-field" placeholder="Apellido"></input>
                <input id="documentation-field" placeholder="DNI"></input>
                <button onClick={CreateUser}>Crear Cuenta</button>
            </form>
        </div>
    )
}

export default Register;
